import React, { VFC } from "react"
import MBUX from "assets/images/MBUX.jpg"
import { Card, CardMedia, Grid, Typography } from "@mui/material"
import styled from "@emotion/styled"

interface Props {
  title: string
  subtitle?: string
  body: string
}

const MediaCard: VFC<Props> = ({ title, subtitle, body }) => {
  const StyledCard = styled(Card)`
    background-color: "white";
  `
  const styles = {
    card: {},
    textContainer: {
      padding: "16px",
    },
  }
  const MbuxImage = () => {
    return <img src={MBUX} alt="MBUX" style={{ maxWidth: "100%" }} />
  }
  return (
    <StyledCard>
      <Grid>
        <MbuxImage />
        <Grid style={styles.textContainer}>
          <Typography variant="h3"></Typography>
          {subtitle && <Typography variant="subtitle2">2021</Typography>}
          <Typography variant="body2">This work is very cool</Typography>
        </Grid>
      </Grid>
    </StyledCard>
  )
}

export default MediaCard
